import logo from "./logo.svg";
import "./App.css";
import Datas from "./data.json";

function App() {
  return (
    <div className="App">
      <h1>DATA</h1>
      <ul>
        {Datas.map((data) => {
          {
            data.color;
          }
        })}
      </ul>
    </div>
  );
}

export default App;
